import React from 'react'
import { Navigate, useNavigate } from 'react-router-dom'
import classes from './sideBar.module.css'

const NavigateSideBar = useNavigate()

export default function SideBar() {
  return (
    <div className={classes.nav}>
      <nav>
        <ul>
            <li onClick={() => {
              Navigate
            }}>Dashboard</li>
            <li>People</li>
            <li>Add People</li>
        </ul>
      </nav>
    </div>
  )
}
